pragma solidity ^0.8.0;

/**
 * @title Counters
 * @author Matt Condon (@shrugs)
 * @dev Provides counters that can only be incremented, decremented or reset. This can be used e.g. to track the number
 * of elements in a mapping, issuing ERC721 ids, or counting request ids.
 *
 * Include with `using Counters for Counters.Counter;`
 */
library CountersUpgradeable {
    struct Counter {
        // This variable should never be directly accessed by users of the library: interactions must be restricted to
        // the library's function. As of Solidity v0.5.2, this cannot be enforced, though there is a proposal to add
        // this feature: see https://github.com/ethereum/solidity/issues/4637
        uint256 _value; // default: 0
    }

    function current(Counter storage counter) internal view returns (uint256) {
        return counter._value;
    }

    function increment(Counter storage counter) internal {
        unchecked {
            counter._value += 1;
        }
    }

    function decrement(Counter storage counter) internal {
        uint256 value = counter._value;
        require(value > 0, "Counter: decrement overflow");
        unchecked {
            counter._value = value - 1;
        }
    }

    function reset(Counter storage counter) internal {
        counter._value = 0;
    }
}
","keccak256":"0x798741e231b22b81e2dd2eddaaf8832dee4baf5cd8e2dbaa5c1dd12a1c053c4d","license":"MIT"},"contracts/GameBase.sol":{"content":"//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.9;

import "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import "hardhat/console.sol";
import "./Multiplayer.sol";

contract GameBase {
    using CountersUpgradeable for CountersUpgradeable.Counter;
    using Multiplayer for Multiplayer.Games;
    using Multiplayer for Multiplayer.Game;

    /** Properties **/
    CountersUpgradeable.Counter public gamesPlayed;
    Multiplayer.Games private games;

    /** Events **/
    event GameCreated(uint256 gameId);
    event GameJoined(uint256 gameId, address player);
    event GameFinished(uint256 gameId);

    /** Methods **/
    function listGames() public view returns (uint256[] memory) {
        uint256[] memory list = games.list();
        console.log("Found %s games", list.length);
        return list;
    }

    function getGames() public view returns (Multiplayer.Game[] memory) {
        uint256[] memory list = games.list();
        Multiplayer.Game[] memory data = new Multiplayer.Game[](list.length);
        for (uint256 i = 0; i < list.length; i++) {
            data[i] = games.get(list[i]);
        }
        return data;
    }

    function getGame(uint256 gameId) public view returns (Multiplayer.Game memory) {
        return games.get(gameId);
    }

    function createGame() public {
        gamesPlayed.increment();
        uint256 gameId = gamesPlayed.current();
        address player = msg.sender;
        games.create(gameId, player);
        console.log("Created new game with ID %s!", gameId);
        emit GameCreated(gameId);
    }

    function joinGame(uint256 gameId) public {
        address player = msg.sender;
        games.join(gameId, player);
        console.log("Player %s joined game %s!", player, gameId);
        emit GameJoined(gameId, player);
    }

    function finishGame(uint256 gameId) public {
        address player = msg.sender;
        games.finish(gameId, player);
        console.log("Player %s finished game %s!", player, gameId);
        emit GameFinished(gameId);
    }
}
","keccak256":"0x991994b33513c0523cd84aa0f38b4a0cbc68195cb0ddc1b94faa1db090c4f804","license":"Unlicense"},"contracts/Multiplayer.sol":{"content":"//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.9;

import "hardhat/console.sol";

library Multiplayer {
    struct Game {
        uint256 timestamp;
        address[2] players;
        uint24 state;
        bool isOpen;
        bool isPlaying;
        bool isDone;
    }

    struct Games {
        uint256[] gameIds;
        mapping(uint256 => Game) data;
        mapping(uint256 => uint256) indexOf;
        mapping(uint256 => bool) inserted;
    }

    function list(Games storage games) internal view returns (uint256[] memory) {
        return games.gameIds;
    }

    function get(Games storage games, uint256 gameId) internal view returns (Game memory) {
        require(exists(games, gameId), "Game does not exist");
        return games.data[gameId];
    }

    function getAtIndex(Games storage games, uint256 index) internal view returns (uint256) {
        return games.gameIds[index];
    }

    function getPlayers(Games storage games, uint256 gameId) internal view returns (address[2] memory) {
        require(exists(games, gameId), "Game does not exist");
        return games.data[gameId].players;
    }

    function exists(Games storage games, uint256 gameId) internal view returns (bool) {
        return games.inserted[gameId];
    }

    function isOpen(Games storage games, uint256 gameId) internal view returns (bool) {
        require(exists(games, gameId), "Game does not exist");
        return games.data[gameId].isOpen;
    }

    function isPlaying(Games storage games, uint256 gameId) internal view returns (bool) {
        require(exists(games, gameId), "Game does not exist");
        return games.data[gameId].isPlaying;
    }

    function create(
        Games storage games,
        uint256 gameId,
        address player
    ) public {
        require(!exists(games, gameId), "Game already exists");

        Multiplayer.Game memory game;

        game.timestamp = block.timestamp;
        game.players[1] = player;
        game.state = 0x0;
        game.isOpen = true;
        game.isPlaying = false;
        game.isDone = false;

        games.inserted[gameId] = true;
        games.data[gameId] = game;
        games.indexOf[gameId] = games.gameIds.length;
        games.gameIds.push(gameId);
    }

    function join(
        Games storage games,
        uint256 gameId,
        address player
    ) public {
        require(exists(games, gameId), "Game does not exist");
        require(isOpen(games, gameId), "Game is full");
        require(getPlayers(games, gameId)[1] != player, "Player already joined");

        Multiplayer.Game memory game = games.data[gameId];

        game.players[0] = player;
        game.isOpen = false;
        game.isPlaying = true;

        games.data[gameId] = game;
    }

    function finish(
        Games storage games,
        uint256 gameId,
        address player
    ) public {
        require(exists(games, gameId), "Game does not exist");
        require(isPlaying(games, gameId), "Game is not in progress");
        require(
            getPlayers(games, gameId)[0] == player || getPlayers(games, gameId)[1] == player,
            "Player is not part of game"
        );

        Multiplayer.Game memory game = games.data[gameId];

        game.isPlaying = false;
        game.isDone = true;

        games.data[gameId] = game;
    }
}
